import "./MenuCSS.css";

const Menu = () => {
  return (
    <div className="menu-container">
      <menu>
        <div className="menu-item">Edit Post</div>
        <div className="menu-item red">Delete Post</div>
      </menu>
    </div>
  );
};

export default Menu;
